import React from "react"; 
import "./style.css";

function Footer() {  
    return (
        <div id="footer" className="jumbotron jumbotron-fluid pt-0 pb-0 mb-0">
            <div className="container pt-4 text-center">
                <small className="text-white align-bottom font-weight-bold">Made with fun by Namita, Sophie, Kevin & Samuel</small>
            </div>
        </div>
    );
}

export default Footer;
